Verenigde Staten
Drama
114 minuten

een goeie film

met Drew Fuller, Bill Cobbs en Abigail Breslin

Jason Stevens is een verwaande jongeman die nooit ergens voor heeft moeten werken. Na de dood van zijn grootvader, waar hij een 
slechte band mee had, verwacht hij dan ook niets te erven. Dan hoort hij dat zijn grootvader hem een aantal &quot;geschenken&quot; n
alaat, maar die geschenken bestaan zoals Jason denkt niet uit geld of goederen. Langzaam leert hij het geschenk van ware 
rijkdom, vriendschap, familie, arbeid, liefde, dankbaarheid en nog veel meer.
